import joker from './images/joker.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <ul id="navigationBar">
        <img src={joker} className='icon'/>
        <span id="namePlace"><b>RJ Paraiso</b></span> / Programmer
      </ul>
    </div>
  );
}

export default App;
